import { sickData } from 'redux/reducer/searchSlice';

interface props {
  data: { sickCd: string; sickNm: string }[];
}

// 변수 : 타입 형태로

export const sickNmMap = ({ data }: props) => {
  data.map(el => {
    return {
      sickNm: el.sickNm,
    };
  });
};
